  input: 'TEXT,F3XA,,"(NEW 1/27/2006) According to our records and analysis: (1) the
    transfer on July 11, 2005 in the amount of $2,133.44applies to expenditures in
    the period 5/11/05 - 5/31/05; (2) the transfers on July 25, 2005 aggregating $8,072.58
    applied to administrative and fund raising expenditures paid in June 2005; (3)
    the transfer on August 12, 2005 of $5,598.55 applies to July 2005 expenditures;
    and (4) the transfer on September 9, 2005 of $5,222.51 applies to expenditures
    made in August 2005. Accordingly, as we analyze it, our transfers from our non-federal
    accounts to our allocation account are correct and no change is required. As previously
    explained, our Committee maintains a separate allocation checking account as part
    of our overall federal account through which allocable expenditures are paid so
    that monies transferred from non-federal accounts to this separate allocation
    checking account are kept separate from other federal account monies. A more detailed
    explanation appears in our letter dated January 27, 2006, responding to Mr. Morse''s
    January 6, 2006 letter."'
